import React from "react";
import Parse from "parse";

export default function ChatList() {
  async function queryUserArray() {
    try {
      const queryAllUsers = new Parse.Query("User");
      const result = await queryAllUsers.find();
      console.log(result);
      let names = [];
      result.forEach((object) => names.push(object.get("username")));
      console.log("User names array: ", names);
      const listNames = names.map((name) => (name = "<li>" + name + "</li>"));
      return listNames;
    } catch (error) {
      console.log(error);
    }
  }
  const list = queryUserArray();
  console.log("NAMES with li", list);

  return <ul>{list}</ul>;
}
